import React, {Component} from 'react';


class GameOver extends Component {

    render() {
        const {score,restartGame} = this.props;
        return (
            <div className={'jumbotron game-over'}>
                <h1 className={'display-3 text-center'}>Поздравляем!</h1>
                <p className={'lead text-center'}>
                    {`Вы прошли викторину и набрали ${score}  из 30 возможных баллов`}
                </p>
                <hr className={'my-4'}/>
                <button className={'btn btn-primary btn-game-over'} onClick={restartGame}>Попробовать еще раз!</button>
            </div>
        );
    }
}

export default GameOver;
